'use strict';

window.addEventListener('DOMContentLoaded',function(){
	
	let canPlayBeep = false;
	
	
	
	var TrainingTimer = function(trngSecId, itvlSecId, trngSetId, timerAreaId){
		this._trngSec = parseInt(document.getElementById(trngSecId).value*60,10);
		this._itvlSec = parseInt(document.getElementById(itvlSecId).value*60,10);
		this._trngSet = parseInt(document.getElementById(trngSetId).value, 10);
		this._timerAreaId = timerAreaId;
		this._timerArea = document.getElementById(this._timerAreaId);
		this._totalTrngSec = (this._trngSec + this._itvlSec) * this._trngSet;
		this._spendTime = 0;
		this._timerArea.textContent = this.showTime();
		this.isStarting = false;
	}
	
	TrainingTimer.prototype = {
		
		getTotalTrngTime:	function(){
								return (this._totalTrngSec != null && typeof(this._totalTrngSec) != 'undefined') 
								? cnvtHhmmss(this._totalTrngSec)
								: cnvtHhmmss(0);
							},
							
		showTime :			function(){
								let timeStr = cnvtHhmmss(this._totalTrngSec - this._spendTime);
								this._timerArea.innerText = timeStr;
								return timeStr;
							},
							
		startCountDown:		function(){
								if(this.isStarting || this._spendTime >= this._totalTrngSec){return false;}
								
								this.isStarting = true;
								this.timeInter = setInterval(() => {
									
									if(this._spendTime >= this._totalTrngSec){
										this.stopCountDown();
										return;
									}
									
									this._spendTime++;
									this.showTime();
									
									if(this._spendTime % (this._trngSec+this._itvlSec) == 0){
										BeepMediator.playBeep(fileIdObj.starting);
										this._timerArea.classList.remove('itvl_trng');
										this._timerArea.classList.add('now_trng');
									}else if(((this._spendTime - this._trngSec) % (this._trngSec+this._itvlSec)) == 0){
										BeepMediator.playBeep(fileIdObj.interval);
										this._timerArea.classList.remove('now_trng');
										this._timerArea.classList.add('itvl_trng');
									}
									
									
								}, 1000);
								BeepMediator.playBeep(fileIdObj.start);
								this._timerArea.classList.add('now_trng');
								return this.showTime();
							},
							
		reset:	 			function(){
								this.stopCountDown();
								this._spendTime = 0;
								this.showTime();
							},
							
		stopCountDown:		function(){
								clearInterval(this.timeInter);
								//BeepMediator.playBeep(fileIdObj.stop);
								this.isStarting = false;
								this._timerArea.classList.remove('now_trng');
								this._timerArea.classList.remove('itvl_trng');
								return true;
							}
							
							
		
	}
	
	var Beep = function(fileIds){
		
		var self = this;
		
		// ファイルIDに対応したマップ
		this.fileDataMap = new Map();
		
		// ファイルIDに対応した、Audioオブジェクト
		this.audioMap = new Map();
		
		if(!(fileIds instanceof Array)){
			throw new Error('IllegalArguments Exception.\r\n'+fileIds+" が配列ではありません。");
		}
		this._fileIds = fileIds;
		
		for(let i = 0, ilen = this._fileIds.length; i < ilen; i++){
			let fileElm = document.getElementById(fileIds[i]);
			fileElm.addEventListener('change',function(){
				self.loadFileData();
			});
		}
		
		BeepMediator.register(self);
	}
	
	Beep.prototype = {
		
		loadFileData:	function(){
							for(let i = 0, ilen = this._fileIds.length; i < ilen; i++){
								let fileobj = document.getElementById(this._fileIds[i]).files[0];
								let content = "";
								
								if(fileobj == null || typeof(fileobj)== 'undefined'){continue;}
								
								if(fileobj.type.indexOf('text')==0){
									let fileReader = new FileReader();
									fileReader.cstmObj = {
										"fileId":	this._fileIds[i],
										beepObj:	this,
									}
									fileReader.onload = function(evt){
										content = evt.target.result;
										let beep = fileReader.cstmObj.beepObj;
										let fileId = fileReader.cstmObj["fileId"];
										beep.fileDataMap.set(fileId, content);
										beep.audioMap.set(fileId, new Audio("data:audio/wav;base64," + content));
									}
									fileReader.readAsText(fileobj);
									
								}
							}
						},
		
		directLoad:		function(fileIds, datas){
							if(fileIds.length != datas.length){
								throw new Error('配列の長さが一致しません。['+fileIds+'='+fileIds.length+' / '+datas+'='+datas.length+']');
							}
							for(let i = 0, ilen = fileIds.length; i < ilen; i++){
								this.fileDataMap.set(fileIds[i], datas[i]);
								this.audioMap.set(fileIds[i], new Audio("data:audio/wav;base64," + datas[i]));
							}
						},
		
		getFileData:	function(id){
							return this.fileDataMap.get(id);
						},
						
						
						
		play:			function(id){
							this.audioMap.get(id).play();
						}
	}
	

	function sleepByPromise(sec) {
		return new Promise(resolve => setTimeout(resolve, sec*1000));
	}

	async function wait(sec) {
		console.log('wait ' + sec.toString() + ' sec right now!');
		await sleepByPromise(sec);
		console.log('wait ' + sec.toString() + ' sec done!');
    }
	
	
	var BeepMediator = {
		beepObj:		null,
		register:	function(obj){
							this.beepObj = obj;
						},
		
		playBeep:		function(id){
							if(!canPlayBeep){return false;}
							if(this.beepObj == null){
								throw new Error('ビープ再生用オブジェクトが初期化されていません。')
							}
							this.beepObj.play(id);
						}
	}
	
	function cnvtHhmmss(timeSec){
		const hours = Math.floor(timeSec / (60*60));
		const minuites = Math.floor((timeSec % (60*60))/60);
		const seconds = Math.floor(timeSec % 60);
		return hours+":"+minuites+":"+seconds;
	}
	
	var fileIdObj = {
		start:		'file_strt_beep',
		starting:	'file_strt_beep',
		interval:	'file_stp_beep',
		stop:		'file_stp_beep'
	}
	
	var elmIdObj__ = {
		trngSec:	'txt_trng_time',
		itvlSec:	'txt_itvl_time',
		trngSet:	'txt_set_cnt',
		dspArea:	'dsp_tmr'
	}
	
	var elmIds = [
		'txt_trng_time',
		'txt_itvl_time',
		'txt_set_cnt',
		'dsp_tmr'
	]
	
	function init(){

		// Check for the various File API support.
		if (window.File && window.FileReader && window.FileList && window.Blob) {
		  // Great success! All the File APIs are supported.
		  canPlayBeep = true;
		} else {
		  //alert('The File APIs are not fully supported in this browser.');
		  alert('お使いのブラウザでは、File APIがサポートされていません。\r\nビープ音が再生されません。');
		}
		
		var beepObj = new Beep([fileIdObj.start,fileIdObj.stop]);
		
		beepObj.directLoad([fileIdObj.start,fileIdObj.stop], [START_WAV, STOP_WAV]);
		
		// タイマーオブジェクト生成
		var timer = new TrainingTimer(...elmIds);
		
		// スタートボタンにイベントを付与する
		const strtBtn = document.getElementById('btn_tmr_strt');
		strtBtn.addEventListener('click',function(){
			timer.startCountDown();
		},false);
		
		// ストップボタンにイベントを付与する
		const stpBtn = document.getElementById('btn_tmr_stp');
		stpBtn.addEventListener('click',function(){
			timer.stopCountDown();
		},false);
		
		// リセットボタンにイベントを付与する
		const rstBtn = document.getElementById('btn_tmr_rst');
		rstBtn.addEventListener('click',function(){
			timer.reset();
		}, false);
		
		for(let i = 0, ilen = elmIds.length; i < ilen; i++){
			document.getElementById(elmIds[i]).addEventListener('change',function(){
				timer.reset();
				timer = new TrainingTimer(...elmIds);
			}, false);
		}
		
		
		
		//Setupthedndlisteners.
		var dropZone = document.getElementById('drop_zone');
		dropZone.addEventListener('dragover',handleDragOver,false);
		dropZone.addEventListener('drop',handleFileSelect, false);
		
	}
	
	
	

	
	
	
	function handleFileSelect(evt){
		evt.stopPropagation();
		evt.preventDefault();
		
		//File List object.
		let files = evt.dataTransfer.files;

		//files is a File List of File objects. List some properties.
		let output=[];
		for ( var i = 0, f; f = files[i]; i++){
			output.push('<li><strong>', escape(f.name), '</strong>(', f.type||'n/a', ')-', f.size,'bytes', '</li>');
		}
		document.getElementById('file_strt_beep').innerHTML='<ul>'+output.join('')+'</ul>';
	}

	function handleDragOver(evt){
		evt.stopPropagation();
		evt.preventDefault();
		evt.dataTransfer.dropEffect='copy';//Explicitly show this is a copy.
	}

	
	
	
	
	const START_WAV = "";
	
	const STOP_WAV = "";
	
	init();
	
	
});